import React, { useState, useEffect } from 'react';
import useCounter from "./useCounter";

const App = () => {
  const { counter, setCounter } = useCounter();
  useEffect(() => {
    console.log('Hello log!');
  }, [counter]);

  return (
    <>
      <h1>
        {counter}
      </h1>
      <button onClick={() => setCounter(counter + 1)}>Increment</button>
    </>
  );
};

export default App;
